import React from 'react';
import './Button.css';

const  Button = (props) => {
   let myClasses = `${props.cls} Btn`;
   return (
      <button
         type="button"
         className={myClasses}
         onClick={props.clicked}
      >
         {props.children}
      </button>
   )
};

export default Button;
